            const id = $(this).data(""id"");
            const row = $(this).parents(""tr"");

            await swal.fire({
                icon:""error"",
                title: ""Are you sure?"",
                confirmButtonText: 'Delete',
                showCancelButton: true,
            }).then((result) => {
                if(result.isConfirmed) {
                    $.ajax({
                        url:`/Admin/Room/RemoveRoom/${id}`,
                        method:""POST"",
                        success: async function(response){
                            $(row).remove();
                            await swal.fire({
                                icon:""success"",
                                title: ""Successfully Deleted!""
                            })
                        }
                    })
                }
            })

        })

